CREATE TABLE `isb-cgc-bq.HTAN.tissueOrOrganOfOrigin_to_wholeOrgan_mapping_current`
(
  Whole_Organ STRING OPTIONS(description="Name of whole organ"),
  Tissue_or_Organ_of_Origin STRING OPTIONS(description="Value of HTAN attribute 'Tissue or Organ of Origin'")
)
OPTIONS(
  friendly_name="TISSUE OR ORGAN OF ORIGIN TO WHOLE ORGAN MAPPING TABLE",
  description="Mapping of HTAN \"Tissue or Organ of Origin\" value, which an be organ part, to a whole organ. This table was derived from the json mapping file https://github.com/ncihtan/htan-portal/blob/master/data/human-organ-mappings.json",
  labels=[("access", "open"), ("data_type", "data_dictionary"), ("program", "htan"), ("source", "htan"), ("category", "metadata"), ("status", "current")]
);

CREATE TABLE `isb-cgc-bq.HTAN.dataFileSynapseID_to_BigQueryTableID_map_current`
(
  entityId STRING OPTIONS(description="Synapse ID of Entity"),
  bq_table_id STRING OPTIONS(description="BigQuery table ID in the format <project-name>.<dataset-name>.<table-name>")
)
OPTIONS(
  friendly_name="HTAN ASSAY FILE SYNAPSE ID TO CGC BIGQUERY TABLE ID MAP",
  description="This table was generated in April 2024 and contains mapping information between assay tables available in Big Query and the relevant individual synapse entities that comprise them.",
  labels=[("access", "open"), ("data_type", "file_metadata"), ("program", "htan"), ("source", "htan"), ("category", "metadata"), ("status", "current")]
);
